env:
  browser: true
  es2021: true
extends: airbnb-base
overrides: []
parserOptions:
  ecmaVersion: latest
  sourceType: module
rules: {
   no-unused-expressions: 0
  import/prefer-default-export: 0
  import/no-cycle: 0
  no-console: 0
  no-param-reassign: 0
  import/extensions: 0
  import/no-extraneous-dependencies: 0
}
